import React from "react";
import { Layout, Menu } from "antd";
import { UserOutlined, HomeOutlined, CrownOutlined } from "@ant-design/icons";
import SubMenu from "antd/lib/menu/SubMenu";
import { useNavigate } from "react-router";

const { Sider } = Layout;

const menuList = [
  {
    "id": 1,
    "title": "首页",
    "key": "/home",
    "pagepermission": 1,
    "grade": 1,
    icon: <HomeOutlined />,
    "children": []
  },
  {
    "id": 2,
    "title": "用户管理",
    "key": "/user-manage",
    "pagepermission": 1,
    "grade": 1,
    icon: <UserOutlined />,
    "children": [
      {
        "id": 3,
        "title": "添加用户",
        "rightId": 2,
        "key": "/user-manage/add",
        "grade": 2
      },
      {
        "id": 4,
        "title": "删除用户",
        "rightId": 2,
        "key": "/user-manage/delete",
        "grade": 2
      },
      {
        "id": 5,
        "title": "修改用户",
        "rightId": 2,
        "key": "/user-manage/update",
        "grade": 2
      },
      {
        "id": 6,
        "title": "用户列表",
        "rightId": 2,
        "key": "/user-manage/list",
        "pagepermission": 1,
        "grade": 2
      }
    ]
  },
  {
    "id": 7,
    "title": "权限管理",
    "key": "/right-manage",
    "pagepermission": 1,
    "grade": 1,
    icon: <HomeOutlined />,
    "children": [
      {
        "id": 8,
        "title": "角色列表",
        "rightId": 7,
        "key": "/right-manage/role/list",
        "pagepermission": 1,
        "grade": 2
      },
      {
        "id": 9,
        "title": "权限列表",
        "rightId": 7,
        "key": "/right-manage/right/list",
        "pagepermission": 1,
        "grade": 2
      },
      {
        "id": 10,
        "title": "修改角色",
        "rightId": 7,
        "key": "/right-manage/role/update",
        "grade": 2
      },
      {
        "id": 11,
        "title": "删除角色",
        "rightId": 7,
        "key": "/right-manage/role/delete",
        "grade": 2
      },
      {
        "id": 12,
        "title": "修改权限",
        "rightId": 7,
        "key": "/right-manage/right/update",
        "grade": 2
      },
      {
        "id": 13,
        "title": "删除权限",
        "rightId": 7,
        "key": "/right-manage/right/delete",
        "grade": 2
      }
    ]
  },
  {
    "id": 14,
    "title": "新闻管理",
    "key": "/news-manage",
    "pagepermission": 1,
    "grade": 1,
    icon: <HomeOutlined />,
    "children": [
      {
        "id": 15,
        "title": "新闻列表",
        "rightId": 14,
        "key": "/news-manage/list",
        "grade": 2
      },
      {
        "id": 16,
        "title": "撰写新闻",
        "rightId": 14,
        "key": "/news-manage/add",
        "pagepermission": 1,
        "grade": 2
      },
      {
        "id": 17,
        "title": "新闻更新",
        "rightId": 14,
        "key": "/news-manage/update/:id",
        "routepermission": 1,
        "grade": 2
      },
      {
        "id": 18,
        "title": "新闻预览",
        "rightId": 14,
        "key": "/news-manage/preview/:id",
        "routepermission": 1,
        "grade": 2
      },
      {
        "id": 19,
        "title": "草稿箱",
        "rightId": 14,
        "key": "/news-manage/draft",
        "pagepermission": 1,
        "grade": 2
      },
      {
        "id": 20,
        "title": "新闻分类",
        "rightId": 14,
        "key": "/news-manage/category",
        "pagepermission": 1,
        "grade": 2
      }
    ]
  },
  {
    "id": 21,
    "title": "审核管理",
    "key": "/audit-manage",
    "pagepermission": 1,
    "grade": 1,
    "children": [
      {
        "id": 22,
        "title": "审核新闻",
        "rightId": 21,
        "key": "/audit-manage/audit",
        "pagepermission": 1,
        "grade": 2
      },
      {
        "id": 23,
        "title": "审核列表",
        "rightId": 21,
        "key": "/audit-manage/list",
        "pagepermission": 1,
        "grade": 2
      }
    ]
  },
  {
    "id": 24,
    "title": "发布管理",
    "key": "/publish-manage",
    "pagepermission": 1,
    "grade": 1,
    "children": [
      {
        "id": 25,
        "title": "待发布",
        "rightId": 24,
        "key": "/publish-manage/unpublished",
        "pagepermission": 1,
        "grade": 2
      },
      {
        "id": 26,
        "title": "已发布",
        "rightId": 24,
        "key": "/publish-manage/published",
        "pagepermission": 1,
        "grade": 2
      },
      {
        "id": 27,
        "title": "已下线",
        "rightId": 24,
        "key": "/publish-manage/sunset",
        "pagepermission": 1,
        "grade": 2
      }
    ],
  },
];

export default function SideMenu({ collapsed }) {
  let navigate = useNavigate();
  // Menu
  const renderMenu = (menuList) => {
    return menuList.map((item) => {
      if (item.children) {
        return (
          <SubMenu key={item.key} icon={item.icon} title={item.title}>
            {renderMenu(item.children)}
          </SubMenu>
        );
      }
      return (
        <Menu.Item
          key={item.key}
          icon={item.icon}
          onClick={() => navigate(item.key)}
        >
          {item.title}
        </Menu.Item>
      );
    });
  };

  return (
    <Sider trigger={null} collapsible collapsed={collapsed}>
      <div className="logo" />
      <Menu theme="dark" mode="inline" defaultSelectedKeys={["1"]}>
        {renderMenu(menuList)}
      </Menu>
    </Sider>
  );
}
